def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    if not all(data._is_homogeneous_type()):
        return super()._cython_agg_blocks(
            how=how, alt=alt, numeric_only=numeric_only, min_count=min_count
        )

    result_blocks = []
    for g, b in data.items():
        if isinstance(b.dtype, pd.Int64Dtype):
            subset = self.obj[b]
            result = subset.groupby(self.grouper).aggregate(how, axis=self.axis)

            # Downcast the resulting groupby to float
            result = maybe_downcast_objects(result, downcast=pd.Float64Dtype())
            result = result.to_numpy().reshape(-1, 1)

            result_block = make_block(result, placement=subset.placement)
            result_blocks.append(result_block)
        else:
            result_blocks.append(b.make_block(None))

    result_blocks, new_items = self._concat_blocks(result_blocks)
    return result_blocks, new_items
